%pyspark
from pyspark.sql.functions import udf, collect_list
from pyspark.sql.types import IntegerType, FloatType

def mid(vals):
    try:
        vals = vals.sort()
        for i in range(len(vals)):
            if not vals[i]:
                vals[i] = 0
            else:
                pass
    except:
        return 0
    # return vals[13] - vals[11]
    return len(vals)

udf_sort = udf(lambda *l: list(l).sort())
udf_mid = udf(mid, IntegerType())

# asos4.groupby('date').agg(udf_sort(collect_list('solar_radiation')).alias('solar_rad')).show(20, False)
asos5 = asos4.groupby('date').agg(udf_mid(collect_list('solar_radiation')).alias('solar_rad')).sort('date')
asos5.show()
